import Item from "./components/Item";

function App() {
  const items = [
    {
      id: 1,
      title: "Plane Tickets",
      cost: 450,
      date: new Date(2023, 2, 1),
    },
    {
      id: 2,
      title: "MacDonalds",
      cost: 5,
      date: new Date(2023, 5, 1),
    },
    {
      id: 3,
      title: "Headphones",
      cost: 80,
      date: new Date(2023, 11, 1),
    },
    {
      id: 4,
      title: "Chocolate Bar",
      cost: 10,
      date: new Date(1, 12, 2023),
    },
  ];
  return (
    <div>
      <h1>Let's get started!</h1>
      <Item
        title={items[0].title}
        cost={items[0].cost}
        date={items[0].date}
      ></Item>
      <Item
        title={items[1].title}
        cost={items[1].cost}
        date={items[1].date}
      ></Item>
      <Item
        title={items[2].title}
        cost={items[2].cost}
        date={items[2].date}
      ></Item>
      <Item
        title={items[3].title}
        cost={items[3].cost}
        date={items[3].date}
      ></Item>
    </div>
  );
}

export default App;
